import React from 'react'

export default function HeaderLogin(props:{
    nickName:string,
}) {
  return (
    <>
    <div className='flex flex-col items-center'>
        <div className='bg-avatar w-[50px] h-[50px] bg-cover rounded-3xl  mb-1'></div>
        <p className='font-normal text-cyan-400'>{props.nickName}</p>
        <button className='bg-inherit w-[50px] h-[25px] text-red'>Выйти</button>
    </div>
    </>
  )
}
